const styles = theme => ({
    questionPaper: {
        width: "50vw",
        marginTop: theme.spacing(2),
    },
    mainArea: {
        flexGrow: 1,
    },
    cascadeInput: {
        width: theme.spacing(4),
    }
});

export default styles;
